const React = require('react');
const PropTypes = require('prop-types');
const UserLinks = require('../user-links');

const DesktopGuestUserMenu = (props) => {
  const { userLinks } = props;

  return (
    <UserLinks {...userLinks} />
  );
};

DesktopGuestUserMenu.propTypes = {
  userLinks: PropTypes.object.isRequired,
};

module.exports = DesktopGuestUserMenu;
